    # Resolve IP
    $IP = $null
    $Ping = New-Object System.Net.NetworkInformation.Ping 
    $Result = $Ping.Send($ComputerName, 15)
    if ($Result.Status -eq 'Success') {
    $IP = $Result.Address.IPAddressToString
